static word get_nat(){
word result=0;
word new,i;
do{
i=*hp++;
new=result<<7;
if(result!=new>>7)
exit(9);
result=new+(i&127);
}while(i&128);
return result;
}
static word*get_field(word*ptrs,int pos){
if(0==*hp){
byte type;
hp++;
type=*hp++;
*fp++=make_immediate(get_nat(),type);
}else{
word diff=get_nat();
if(ptrs!=NULL)
*fp++=ptrs[pos-diff];
}
return fp;
}
static word*get_obj(word*ptrs,int me){
uint type,size;
if(ptrs!=NULL)
ptrs[me]=(word)fp;
switch(*hp++){
case 1:
type=*hp++;
size=get_nat();
*fp++=make_header(size+1,type);
while(size--)
fp=get_field(ptrs,me);
break;
case 2:{
type=*hp++&31;
size=get_nat();
memcpy((word*)mkraw(type,size)+1,hp,size);
hp+=size;
break;
}
default:
exit(42);
}
return fp;
}
static void get_obj_metrics(int*rwords,int*rnobjs){
int size;
switch(*hp++){
case 1:
hp++;
size=get_nat();
*rnobjs+=1;
*rwords+=size;
while(size--){
if(0==*hp)
hp+=2;
get_nat();
}
break;
case 2:
hp++;
size=get_nat();
*rnobjs+=1;
*rwords+=(W+size+W-1)/W;
hp+=size;
break;
default:
exit(42);
}
}
static void heap_metrics(int*rwords,int*rnobjs){
const byte*hp_start=hp;
while(*hp!=0)
get_obj_metrics(rwords,rnobjs);
hp=hp_start;
}
static void read_heap(const char*path){
struct stat st;
off_t pos=0;
ssize_t n;
int fd=open(path,O_RDONLY);
if(fd==-1)
exit(1);
if(fstat(fd,&st)!=0)
exit(2);
file_heap=realloc(NULL,st.st_size);
if(file_heap==NULL)
exit(3);
do{
n=read(fd,file_heap+pos,st.st_size-pos);
if(n==-1)
exit(4);
}while(n&&(pos+=n)<st.st_size);
close(fd);
}
static void find_heap(int*nargs,char***argv,int*nobjs,int*nwords){
file_heap=NULL;
if((word)heap==0){
if(*nargs<2)
exit(1);
read_heap(argv[0][1]);
++*argv;
--*nargs;
hp=file_heap;
if(*hp=='#')
while(*hp++!='\n');
}else{
hp=heap;
}
heap_metrics(nwords,nobjs);
}
static word*decode_fasl(uint nobjs){
word*ptrs;
word*entry;
uint pos;
allocate(nobjs+1,ptrs);
for(pos=0;pos!=nobjs;++pos){
if(fp>=memend)
exit(1);
fp=get_obj(ptrs,pos);
}
entry=(word*)ptrs[pos-1];
*ptrs=make_header(nobjs+1,0)|RAWBIT;
return entry;
}
static word*load_heap(uint nobjs){
word*entry=decode_fasl(nobjs);
if(file_heap!=NULL)
free(file_heap);
return entry;
}
static void setup(int nwords,int nobjs){
tcgetattr(0,&tsettings);
state=IFALSE;
set_signal_handler();
max_heap_mb=W==4?4096:65535;
nwords+=nobjs+INITCELLS;
memstart=genstart=fp=realloc(NULL,(nwords+MEMPAD)*W);
if(memstart==NULL)
exit(4);
memend=memstart+nwords-MEMPAD;
}
int main(int nargs,char**argv){
word*prog;
int rval,nobjs=0,nwords=0;
find_heap(&nargs,&argv,&nobjs,&nwords);
setup(nwords,nobjs);
prog=load_heap(nobjs);
rval=vm(prog,onum((uintptr_t)argv,0));
setdown();
if(fixnump(rval)){
int n=immval(rval);
if(!(n&~127))
return n;
}
return 127;
}
